  `execute_params` varchar(500) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '执行参数',
  `execute_fail_msg` varchar(500) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '执行失败原因',
  `create_time` datetime(0) NOT NULL COMMENT '执行时间',
  `consume_time` bigint(13) NOT NULL COMMENT '任务执行消耗时间 单位：毫秒',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `idx_jjob_info_id`(`job_info_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 3024 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '系统任务执行记录表' ROW_FORMAT = Dynamic;

