  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `idx_day`(`day`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 5 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '系统任务执行记录报表' ROW_FORMAT = Dynamic;

